import { Chip } from "@mui/material";

export default function StatusChip({ label, type }) {
  let color = "default";
  let displayLabel = label;

  if (type === "status") {
    if (label === "done") {
      color = "success";
      displayLabel = "Done";
    } else {
      color = "warning";
      displayLabel = "Pending";
    }
  }

  if (type === "priority") {
    if (label === "high") color = "error";
    else if (label === "medium") color = "warning";
    else color = "success";
  }

  return (
    <Chip
      label={displayLabel}
      color={color}
      size="small"
      variant="outlined"
    />
  );
}
